INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div class="aligncenter">\r\n<div class="sixteen columns rnr-animate animated" data-effect="fadeInUp">\r\n                 <h2>How about Some Fun Facts about our agency?</h2>\r\n               </div><!-- END SIXTEEN COLUMNS -->\r\n               \r\n               <div class="four columns">\r\n                 <div class="milestone-counter" data-perc="680">\r\n                   <span class="milestone-count highlight"></span>\r\n                   <h6 class="milestone-details">Pizzas ordered</h6>\r\n                 </div>\r\n               </div><!-- END FOUR COLUMNS -->  \r\n    \r\n               <div class="four columns">\r\n                 <div class="milestone-counter" data-perc="85">\r\n                   <span class="milestone-count highlight"></span>\r\n                   <h6 class="milestone-details">Clients we''ve worked with</h6>\r\n                 </div>\r\n               </div><!-- END FOUR COLUMNS --> \r\n               \r\n               <div class="four columns">\r\n                 <div class="milestone-counter" data-perc="120">\r\n                   <span class="milestone-count highlight"></span>\r\n                   <h6 class="milestone-details">projects completed</h6>\r\n                 </div>\r\n               </div><!-- END FOUR COLUMNS --> \r\n               \r\n               <div class="four columns">\r\n                 <div class="milestone-counter" data-perc="22">\r\n                   <span class="milestone-count highlight"></span>\r\n                   <h6 class="milestone-details">magazines published</h6>\r\n                 </div>\r\n               </div><!-- END FOUR COLUMNS --> \r\n</div>', 'How about Some Fun Facts about our agency?', 'full_html'),
(2, '<div class="aligncenter">\r\n<h3 style="padding-bottom: 10px;">Are you ready to start a conversation?</h3>\r\n<a data-effect="fadeInUp" href="#contact" target="_self" class="button animated scroll-to fadeInUp">Get in touch</a></div>', 'Get in touch', 'full_html'),
(3, '<div class="social-icons">\r\n              <div class="social-icon social-email"><a href="mailto:hallo@example.com" target="_blank" data-original-title="Email">Email</a></div>\r\n              <div class="social-icon social-behance"><a href="#" target="_blank" data-original-title="Behance">Behance</a></div>\r\n              <div class="social-icon social-delicious"><a href="#" target="_blank" data-original-title="Delicious">Delicious</a></div>\r\n              <div class="social-icon social-deviantart"><a href="#" target="_blank" data-original-title="Deviantart">Deviantart</a></div>\r\n              <div class="social-icon social-facebook"><a href="#" target="_blank" data-original-title="Facebook">Facebook</a></div>\r\n              <div class="social-icon social-flickr"><a href="#" target="_blank" data-original-title="Flickr">Flickr</a></div>\r\n              <div class="social-icon social-forrst"><a href="#" target="_blank" data-original-title="Forrst">Forrst</a></div>\r\n</div>\r\n<p>&copy; 2015 All Rights Reserved. Made with <i class="icon-heart"></i> by <a href="http://themeforest.net/user/RockNRollaDesigns">RockNRolla Designs</a> - Developed by <a href="http://themeforest.net/user/NooTheme">Nootheme</a></p>', 'Footer', 'full_html');
